import React, { Component, useState,useCallback } from 'react';
import { StyleSheet, 
         View, 
         Text, 
         Button, 
         Image, 
         ImageBackground, 
         TouchableOpacity,
         Modal,
         TouchableHighlight, 
         StatusBar,
         SafeAreaView, 
         ScrollView, 
        Linking,
        }
          from 'react-native';
import { globalStyles } from '../styles/global';
import Location from '../screens/locations'
import FitImage from 'react-native-fit-image';
import { MaterialIcons } from '@expo/vector-icons';
//import { ScrollView } from 'react-native-gesture-handler';


export default function Home( {navigation} ) {


const [modalVisible, setModalVisible] = useState(false);
const image = require('../assets/connect04.jpeg')
const image2 = require('../assets/connect03.jpeg')
const image3 = require('../assets/connect02.jpeg')
const image4 = require('../assets/connect01.jpeg')


const option01 = () => {
  Linking.openURL('http://www.google.com/images')
} 

  return (

   <View style={globalStyles.connectContainer}>
   <SafeAreaView style={globalStyles.darkHeader}><Text style={globalStyles.headerText}>Equippers</Text></SafeAreaView>
   <ScrollView>
   <View style={globalStyles.connectContent}>
  <TouchableOpacity onPress={option01}>
   <ImageBackground source={image} style={globalStyles.connectItem}><View style={globalStyles.overlay}/><Text style={globalStyles.connectText}>Prayer Request</Text></ImageBackground>
   </TouchableOpacity>


   <ImageBackground source={image2} style={globalStyles.connectItem}><View style={globalStyles.overlay}/><Text style={globalStyles.connectText}>Facebook Comunity</Text></ImageBackground>
   <ImageBackground source={image3} style={globalStyles.connectItem}><View style={globalStyles.overlay}/><Text style={globalStyles.connectText}>VIP</Text></ImageBackground>
   <ImageBackground source={image4} style={globalStyles.connectItem}><View style={globalStyles.overlay}/><Text style={globalStyles.connectText}>VIP</Text></ImageBackground>

       </View>
       </ScrollView>
   </View>


  );

}
